//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;
contract MarketPlace {

    // Product data
    uint256 public productNumber;
    mapping(uint256 => string) public productIdToName;
    mapping(uint256 => string) public productIdToDescription;
    mapping(uint256 => uint256) public productIdToQuantity;    
    mapping(uint256 => address) public productIdToOwner;
    mapping(uint256 => bool) public productIdToAvailability;
    mapping(uint256 => uint256) public productIdToFloorPrice;
    mapping(uint256 => uint256) productIdToHighestBidId;
    mapping(uint256 => uint256) public productIdToLaunchTime;  
    // Bid data
    uint256 bidNumber;
    mapping(uint256 => uint256) bidIdToProductId;
    address payable[] bidders;
    mapping(uint256 => uint256) bidIdToBidAmount;

    event winnerDeclared(uint256 _productId, address _winner );


    constructor () {
        productNumber = 0;
        bidNumber = 0;
    }
    function createProduct(string memory _name, string memory _description, uint256 _quantity) public returns (uint256) {
        productNumber = productNumber + 1;
        productIdToName[productNumber] = _name;
        productIdToDescription[productNumber] = _description;
        productIdToQuantity[productNumber] = _quantity;
        productIdToFloorPrice[productNumber] = 0;
        productIdToAvailability[productNumber] = false;        
        productIdToOwner[productNumber] = msg.sender;
        productIdToHighestBidId[productNumber] = 0;               
        return productNumber;
    }   

    function putUpForSale(uint256 _productId, uint256 _floorPrice, uint256 _launchtime) public {
        require(msg.sender == productIdToOwner[_productId], "Caller is not the owner of this product");
        productIdToAvailability[_productId] = true;
        productIdToFloorPrice[_productId] = _floorPrice;
        productIdToLaunchTime[_productId] = _launchtime;
    }

    function placeBid(uint256 _productId) public payable{
        require(productIdToAvailability[_productId] == true && block.timestamp < productIdToLaunchTime[_productId] && msg.value >= productIdToFloorPrice[_productId] , "Requested product is not taking bids or bid price too low");
        bidNumber = bidNumber + 1;
        bidIdToProductId[bidNumber] = _productId;
        bidders.push(payable(msg.sender));
        bidIdToBidAmount[bidNumber] = msg.value;
        if (msg.value > bidIdToBidAmount[productIdToHighestBidId[_productId]]) {
            productIdToHighestBidId[_productId] = bidNumber;
        }
    }


    function closeBid(uint256 _productId) public payable{
        require(productIdToOwner[_productId] == msg.sender && bidIdToBidAmount[productIdToHighestBidId[_productId]] > 0 && block.timestamp > productIdToLaunchTime[_productId], "Caller is not the owner of this product");
        uint256 winnerBidId = productIdToHighestBidId[_productId];
        address winner = bidders[winnerBidId - 1];
        emit winnerDeclared(_productId, winner);
        productIdToFloorPrice[_productId] = 0;
        productIdToAvailability[_productId] = false;        
        productIdToOwner[_productId] = winner;
        productIdToHighestBidId[_productId] = 0;
        for (uint256 i = 1; i <= bidNumber; i++) {
            if (bidIdToProductId[i] == _productId && bidders[i-1] != winner) {
                address payable bidder = bidders[i - 1];
                bidder.transfer(bidIdToBidAmount[i]);
            }
        }
    }

}
